import { Button, Navbar,Form,Nav,FormControl } from 'react-bootstrap'
import fire from '../../cofigFile/firebase';



export default class cnavbar extends Component {


    logout(){
        fire.auth().signOut();
    }

    render() {
        return (

<nav class="navbar navbar-expand bg-dark navbar-dark justify-content-end">
    <a class="navbar-brand" href="#">Home</a>
    <button class="btn btn-success ml-auto mr-1">Always Show</button>
    <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent">
        <span class="navbar-toggler-icon"></span>
    </button>
    <div class="collapse navbar-collapse flex-grow-0" id="navbarSupportedContent">
        <ul class="navbar-nav text-right">
            <li class="nav-item active">
                <a class="nav-link" href="#">Right Link 1</a>
            </li>
            <li class="nav-item active">
                <a class="nav-link" href="#">Right Link 2</a>
            </li>
        </ul>
    </div>
</nav>
        )
    }
}
